class Solution {
    public int climbStairs(int n) {
        if(n==0)
        {
            return 0;
        }
        List<Integer>alist=new ArrayList<>();
        int first=0;
        int second=1;
        for(int i=1;i<=n;i++)
        {
           int sum=first+second;
           alist.add(sum);
           first=second;
           second=alist.get(alist.size()-1);
        }
        return alist.get(n-1);
    }
}

