class Solution {
    public int climbStairs(int n) {
        Map<Integer,Integer> m=new HashMap<>();
        return climbing(n,m);
    }
    public int climbing(int n,Map<Integer,Integer> m){
        if(n==0||n==1){
            return 1;
        }
        if(!m.containsKey(n)){
            m.put(n,climbing(n-1,m)+climbing(n-2,m));
        }
        return  m.get(n);
    }
}

